const Home = () => {
    return ( 
        <div className="home">
            <section className="navbar" class="justify-content-between d-flex">
                <div className="titles">
                    <h1>Foodie</h1>
                </div>
                <div class=" d-flex p-4 ">
                <p><a class="pe-4 link-dark text " href="">Home</a></p>
                <p><a href="">About</a></p>
                <p><a href="">Foods</a></p>
                <p><a href="">Lifestyle</a></p>
                <p><a href="">Contact</a></p>
                </div>
            </section>
        </div>
     );
}

export default Home;
